import React from "react";
//Styles
import "./styles.css";
const Content_1 = () => {
  const goals = [
    {
      title: "Expand your business",
      description: "Websites should be created for individuals",
    },
    { title: "Responsive Websites", description: "A presence in the web" },
    { title: "Human Computer Interaction", description: "Responsive Websites" },
  ];

  return (
    <div className="content1-main-container">
      <div className="laptop-menu">
        <li>Expand your business</li>
        <li>Responsive Websites</li>
        <li>Human Computer Interaction</li>
      </div>
      <div className="laptop-content">Hello</div>
    </div>
  );
};

export default Content_1;
